Wei Zhao as Qiao Hua
Chun Wu as Judge of the Desert
Kate Tsui as Tuo Tuo
Yuwu Qi as Xuan Wu
Ma Wu as Qiao Yung
Kar-Ying Law as Jia Jingzhong
